250,"height":250},{"url":"https://yt3.ggpht.com/ytc/AAUvwnipkiDkqFs6xZpTvfHt-T7bWKK6ee-mdvPDNHYj=s400-c-k-c0x00ffffff-no-rj","width":400,"height":400}]},"icon":{"thumbnails":[{"url":"https://www.gstatic.com/youtube/img/annotations/youtube.png"}]},"left":0.022807017,"width":0.15438597,"top":0.54906541,"aspectRatio":1,"startMs":"1135565","endMs":"1140565","title":{"accessibility":{"accessibilityData":{"label":"Канал \"Sergey Nemchinskiy\""}},"simpleText":"Sergey Nemchinskiy"},"metadata":{"simpleText":"Меня зовут Сергей Немчинский. Я программист с 20-тилетним опытом. В прошлом работал Project manager в Ciklum, Team Leader в Luxoft, NetCracker и IntroPro, был начальником отдела веб-разработки в ЛигаБизнесИнформ. Параллельно преподавал в учебных центрах Luxoft, NetCraker и IntroPro, и даже работал учителем в школе. Certified Scrum Master.\n\nСейчас я основатель и руководитель учебной компании (курсы программирования онлайн) FoxmindEd, а также основатель компании по разработке программного обеспечения FoxmindEd Software. Направления обучения – Java, С#/.Net, Python, Android, Front-End, Automation QA, UI/UX, Wordpress, Project management, SalesForce, GameDev. Курсы для новичков и продвинутых.\n\nНа этом канале отвечаю на ваши вопросы про работу программистов, стараюсь простыми словами ответить на вопросы о программировании, волнующие новичков, беру интервью у интересных людей из сферы IT и около IT. Кроме того, здесь выкладываю свои выступления и некоторые лекции."},"callToAction":{"simpleText":"ПЕРЕЙТИ"},"dismiss":{"simpleText":"ОТМЕНА"},"endpoint":{"clickTrackingParams":"CCcQ-N4BGAAiEwjZ8N3WvsHuAhUVbZsKHVA3CxYyDGl2LWVuZHNjcmVlbkjFqMrgyJ3YkpQB","commandMetadata":{"webCommandMetadata":{"url":"/channel/UCVbz7l0COUdLupcY4YtYH0w","webPageType":"WEB_PAGE_TYPE_CHANNEL","rootVe":3611,"apiUrl":"/youtubei/v1/browse"}},"browseEndpoint":{"browseId":"UCVbz7l0COUdLupcY4YtYH0w"}},"hovercardButton":{"subscribeButtonRenderer":{"buttonText":{"runs":[{"text":"ВЫ ПОДПИСАНЫ"}]},"subscribed":
